import React from 'react';
import Header from '../Header/Header';
import Promo from './Promo/Promo';

export default function Main(props){
    return(
        <>
        <Header notLog={false}/>
        <main className='main'>
            <Promo />
            <NavTab />
            <AboutProject />
            <Techs />
            <AboutMe />
            <Portfolio />
        </main>
        </>
    )
}
